INSERT INTO `cms_content` VALUES (7,3,'About Us','<p>Eudyoga is the ultimate destination for your Job Search. We search for the best employers providing the best salary in the industry. Our database is a bucket of talents, skills, and jobs according to choice. We make your dreams into reality and offer what you always want. We become the challenge to the competitive world by bringing the best Employer and Employee at the same stage.<br /><br />ಇ-ಉದ್ಯೋಗ ನಿಮ್ಮ ಉದ್ಯೋಗ ಹುಡುಕಾಟಕ್ಕೆ ಅಂತಿಮ ತಾಣವಾಗಿದೆ. ಉದ್ಯಮದಲ್ಲಿ ಉತ್ತಮ ಸಂಬಳವನ್ನು ನೀಡುವ ಅತ್ಯುತ್ತಮ ಉದ್ಯೋಗದಾತರನ್ನು ನಾವು ಹುಡುಕುತ್ತೇವೆ. ನಮ್ಮ ಡೇಟಾಬೇಸ್ ಪ್ರತಿಭೆಗಳು, ಕೌಶಲ್ಯಗಳು ಮತ್ತು ಆಯ್ಕೆಯ ಪ್ರಕಾರ ಉದ್ಯೋಗಗಳ ಬಕೆಟ್ ಆಗಿದೆ. ನಾವು ನಿಮ್ಮ ಕನಸುಗಳನ್ನು ನಿಜವಾಗಿಸುತ್ತೇವೆ ಮತ್ತು ನಿಮಗೆ ಯಾವಾಗಲೂ ಬೇಕಾದುದನ್ನು ನೀಡುತ್ತೇವೆ. ಅತ್ಯುತ್ತಮ ಉದ್ಯೋಗದಾತ ಮತ್ತು ಉದ್ಯೋಗಿಯನ್ನು ಒಂದೇ ಹಂತದಲ್ಲಿ ತರುವ ಮೂಲಕ ನಾವು ಸ್ಪರ್ಧಾತ್ಮಕ ಜಗತ್ತಿಗೆ ಸವಾಲಾಗಿದ್ದೇವೆ.<br /><br />Our candidates share the best experience with their employment. The companies are booming with the talents that we share with them. More than a billion candidates can search for their best-suited jobs from the million companies in our portal. Our experts and career consultants always try to groom our candidates with the best expert to advise.<br /><br />ನಮ್ಮ ಅಭ್ಯರ್ಥಿಗಳು ತಮ್ಮ ಉದ್ಯೋಗದೊಂದಿಗೆ ಉತ್ತಮ ಅನುಭವವನ್ನು ಹಂಚಿಕೊಳ್ಳುತ್ತಾರೆ. ನಾವು ಅವರೊಂದಿಗೆ ಹಂಚಿಕೊಳ್ಳುವ ಪ್ರತಿಭೆಗಳೊಂದಿಗೆ ಕಂಪನಿಗಳು ಪ್ರವರ್ಧಮಾನಕ್ಕೆ ಬರುತ್ತಿವೆ. ಒಂದು ಬಿಲಿಯನ್ಗಿಂತಲೂ ಹೆಚ್ಚು ಅಭ್ಯರ್ಥಿಗಳು ನಮ್ಮ ಪೋರ್ಟಲ್ನಲ್ಲಿರುವ ಮಿಲಿಯನ್ ಕಂಪನಿಗಳಿಂದ ತಮಗೆ ಸೂಕ್ತವಾದ ಉದ್ಯೋಗಗಳನ್ನು ಹುಡುಕಬಹುದು. ನಮ್ಮ ತಜ್ಞರು ಮತ್ತು ವೃತ್ತಿ ಸಲಹೆಗಾರರು ಯಾವಾಗಲೂ ಸಲಹೆ ನೀಡಲು ನಮ್ಮ ಅಭ್ಯರ್ಥಿಗಳನ್ನು ಉತ್ತಮ ಪರಿಣಿತರೊಂದಿಗೆ ಅಲಂಕರಿಸಲು ಪ್ರಯತ್ನಿಸುತ್ತಾರೆ.<br /><br />It is the brainchild of Kavya and Guruswamy. They have worked together to build their vision and thoughts. Thousand Vision World Pvt Ltd made this company incorporated on the 22nd of March 2021 as a Private limited company in Bangalore.<br /><br />ಇದು ಕಾವ್ಯ ಮತ್ತು ಗುರುಸ್ವಾಮಿಯವರ ಕಲ್ಪನೆಯ ಕೂಸು. ಅವರು ತಮ್ಮ ದೃಷ್ಟಿ ಮತ್ತು ಆಲೋಚನೆಗಳನ್ನು ನಿರ್ಮಿಸಲು ಒಟ್ಟಾಗಿ ಕೆಲಸ ಮಾಡಿದ್ದಾರೆ. ಥೌಸಂಡ್ ವಿಷನ್ ವರ್ಲ್ಡ್ ಪ್ರೈವೇಟ್ ಲಿಮಿಟೆಡ್ ಈ ಕಂಪನಿಯನ್ನು 2022 ರ ಮಾರ್ಚ್ 21 ರಂದು ಬೆಂಗಳೂರಿನಲ್ಲಿ ಪ್ರೈವೇಟ್ ಲಿಮಿಟೆಡ್ ಕಂಪನಿಯಾಗಿ ಸಂಯೋಜಿಸಿದೆ.<br /><br />We are growing as a Rainbow with a variety of job openings for youths and professionals. We create an ultimate destinate for the Employers and Employees and help the country with more employment.<br /><br />ಯುವಕರು ಮತ್ತು ವೃತ್ತಿಪರರಿಗೆ ವಿವಿಧ ಉದ್ಯೋಗಾವಕಾಶಗಳೊಂದಿಗೆ ನಾವು ಮಳೆಬಿಲ್ಲಿನಂತೆ ಬೆಳೆಯುತ್ತಿದ್ದೇವೆ. ನಾವು ಉದ್ಯೋಗದಾತರು ಮತ್ತು ಉದ್ಯೋಗಿಗಳಿಗೆ ಅಂತಿಮ ಗಮ್ಯಸ್ಥಾನವನ್ನು ರಚಿಸುತ್ತೇವೆ ಮತ್ತು ಹೆಚ್ಚಿನ ಉದ್ಯೋಗದೊಂದಿಗೆ ದೇಶಕ್ಕೆ ಸಹಾಯ ಮಾಡುತ್ತೇವೆ.</p>','2018-09-12 04:45:03','2023-05-15 13:47:37','en'),(8,4,'Terms & Conditions','<p>Terms of Use for Website</p>\r\n<h1>AGREEMENT TO TERMS</h1>\r\n<p> </p>\r\n<p data-custom-class=\"body_text\">These Terms of Use constitute a legally binding agreement made between you, whether personally or on behalf of an entity (“you”) and Thousand Vision World Pvt Ltd (\"<strong>Company</strong>,\" “<strong>we</strong>,\" “<strong>us</strong>,\" or “<strong>our</strong>”), concerning your access to and use of the <a href=\"http://www.eudyoga.com/\" data-custom-class=\"link\">http://www.eudyoga.com</a> website as well as any other media form, media channel, mobile website or mobile application related, linked, or otherwise connected thereto (collectively, the “Site”). We are registered in India and have our registered office at No 1088/1 K N Ext, Yeshwanthpur Bangalore Bangalore - 560022 Karnataka - India, Bangalore<span data-custom-class=\"body_text\">, karnataka 560022</span><span data-custom-class=\"body_text\">.</span> You agree that by accessing the Site, you have read, understood, and agreed to be bound by all of these Terms of Use. IF YOU DO NOT AGREE WITH ALL OF THESE TERMS OF USE, THEN YOU ARE EXPRESSLY PROHIBITED FROM USING THE SITE AND YOU MUST DISCONTINUE USE IMMEDIATELY.</p>\r\n<p> </p>\r\n<p data-custom-class=\"body_text\">Supplemental terms and conditions or documents that may be posted on the Site from time to time are hereby expressly incorporated