oading the final reports, and placing reports in designated server folders.\r\n9)	Verifying the BGV findings, and collecting the relevant documents for further verification and corrective action.\r\n10)	Preparing BGV summary reports for the Management Review.\r\n11)	Verification of BGV and Retainership bills for the service availed and processing bills for payment.\r\n12)	Maintaining confidentiality by keeping information confidential.\r\n13)	Any other activities related to HR and Admin as per Management instructions.',NULL,NULL,101,17,21,0,NULL,3,NULL,6,0,NULL,1,49,3,1,1,NULL,NULL,5,4,1,0,NULL,'2023-11-19 16:56:37','2024-04-03 12:17:05',NULL,'Officer - HR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(53,98,'2 Wheeler Loan sales Officer',NULL,NULL,NULL,101,17,11,0,NULL,3,20000,25000,0,NULL,1,2,3,1,30,NULL,'2036-05-15 00:00:00',3,1,1,0,NULL,'2023-11-20 06:53:04','2024-04-03 12:17:16',NULL,'2 Wheeler Loan sales Officer',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(55,88,'Accountant','<ul>\r\n<li>Process journal entries on Tally or equivalent software to ensure all business transactions are recorded.</li>\r\n<li>Assist in the processing of balance sheets, income statements and other financial statements according to legal and company accounting and financial guidelines</li>\r\n<li>Assist with reviewing of expenses, payroll records etc.</li>\r\n<li>Update accounts receivable and issue invoices along with follow-ups</li>\r\n<li>Update accounts payable and perform reconciliations</li>\r\n<li>TDS, GST calculations and filing</li>\r\n<li>Assist senior accountants in the preparation of monthly/yearly closings</li>\r\n<li>Assist with other accounting &amp; finance projects.</li>\r\n</ul>',NULL,NULL,101,17,16,0,NULL,2,12000,18000,0,NULL,1,1,3,1,5,NULL,'2023-11-30 00:00:00',4,11,1,0,NULL,'2023-11-21 07:52:10','2024-04-03 12:17:24',NULL,'Accountant',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(56,107,'Executive Telesales','A B2B Tele sales Executive for a CRM (Customer Relationship Management) product is responsible for selling CRM software solutions to other businesses over the phone or through video conferencing. \r\nThe position requires the individual to be responsible for:\r\n1.	Conducting market research to identify potential customers and target industries.\r\n2.	Contacting potential   B2B   customers   by phone or video conference to introduce them to the CRM product offered by the company.\r\n3.	Building rapport with customers and identifying their needs to offer the most appropriate CRM solution.\r\n4.	Making sales pitches and providing product information to customers in a clear and concise manner.\r\n5.	Demonstrating the CRM product and its features to customers.\r\n6.	Closing sales and achieving sales targets set by the company.\r\n7.	Developing and maintaining long-term relationships with key decision-makers in client organizations.\r\n8.	Continually meeting or exceeding daily and monthly targets with respect to call volume and sales.\r\n9.	Managing customer accounts by ensuring that existing customers remain satisfied with company products and services.\r\nKey Proficiency\r\n•	Very good English speaking & writing skills\r\n•	Excellent communication Skill\r\n•	Excellent interpersonal skill\r\n•	Negotiation Skill\r\n•	Sales Presentation Skill\r\n•	Fluency in Regional Languages: Kannada, Tamil & Telugu \r\nEducational Qualification-\r\n•	Any Graduation with 60%\r\nWork Experience: Min 1 year of working experience in sales profile\r\nSalary: 2.4 to 3.6 LPA\r\nLocation: Vasanth Nagar, Bengaluru – 560001',NULL,NULL,101,NULL,14,0,NULL,3,20000,25000,0,NULL,1,137,3,1,5,NULL,'2023-11-28 00:00:00',4,3,1,0,NULL,'2023-11-21 09:09:01','2024-04-03 12:18:29',NULL,'Executive Telesales',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(57,107,'OPERATIONS EXECUTIVE',NULL,NULL,NULL,101,17,15,0,NULL,3,20000,22000,0,NULL,1,65,3,1,1,NULL,'2023-11-30 00:00:00',4,3,1,0,NULL,'2023-11-21 09:11:54','2024-04-03 12:18:10',NULL,'OPERATIONS EXECUTIVE',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(58,108,'Channel Finance Executive','Overview of Role\r\nThe Channel Finance Executive is member of Essmart’s management team, based in Bangalore.\r\nEssmart is seeking for a highly motivated Channel Finance Executive, you will be working closely\r\nwith the sales team to ensure that the company’s products are being sold effectively and efficiently\r\nwhich involves active participation in End-to-End processing of loan proposals. You will act as\r\nliaison between dealers and our financial partner institution and you will help qualified applicants\r\nacquire loans in a timely manner Communicate with dealers either to request or to provide\r\ninformation about the loan process or products. Justify decisions (approvals/rejections) and report\r\non them. Complete loan contracts and counsel dealers on policies and restrictions.\r\nResponsibilities\r\n• Evaluate credit worthiness by processing loan applications and documentation within\r\nspecified limits.\r\n• Communicate with applicants to evaluate their financial eligibility and the possibility of\r\ngranting loans.\r\n• Determine all applicable ratios and metrics and set up debt payment plans.\r\n• Handling credit underwriting of channel finance / term loans cases in the mapped region\r\nincluding visiting the dealers and partners when required.\r\n• Ongoing monitoring of accounts, deferral tracking including tracking developments in the\r\nindustry and the account to identify stress and work with the business teams / credit\r\nmanagers in devising appropriate mitigation strategies wherever needed.\r\n• Good exposure in Relationship management of Channel Finance and term Loan proposals as\r\nwell as monitored accounts on a monthly basis for disbursed accounts in order to maintain a\r\nhealthy portfolio.\r\n• Solicit new business and foster existing customer growth. Grow assigned territory through\r\nrelationship management and organic growth and includes an annual budget for year - end\r\ngrowth.\r\n• Manage the existing loan to ensure establishment of appropriate account plans, recommend\r\ncredit facilities in line with Bank\'s credit policy to maximize earnings while containing risk to\r\nan acceptable level.\r\n• New client acquisition- Supply Chain Finance and dealers Finance.\r\n• Communicate with dealers and financial partners either to request or to provide information.\r\n• Justify decisions (approvals/rejections) and report on them.\r\n• Complete loan contracts and guide dealers on policies and restrictions.\r\n• Ensure that the branch credit team operates efficiently to process credit applications in a\r\ntimely and high-quality manner by following established procedures, adhering to the credit\r\npolicy, and granting the required approvals.\r\n• Collaborate with other departments, such as sales, marketing, and supply chain, to align\r\nfinancial goals and strategies with broader business initiatives.\r\n• Participate in cross-functional teams to address channel-related challenges and opportunities.\r\n• Identify opportunities for process improvement within the channel finance function.\r\n• Implement efficient financial processes to streamline operations and enhance overall\r\neffectiveness.\r\n• Responsible for the collection of the Outstanding payments.\r\nQualifications\r\n• Bachelor\'s degree in Finance, Accounting, Business, or a related field.\r\n• Prior experience as a Channel Finance Executive/Manager.\r\n• Experience in Supply Chain Finance / Wholesale Funding (Inventory Finance) / Dealer Finance\r\nin Bank / NBFC.\r\n• Experience in End-to-End processing of loan proposals.\r\n• Proven experience in finance, preferably with a focus on channel finance or distribution.\r\n• Strong analytical and problem-solving skills.\r\n• Excellent communication and interpersonal skills know south Indian languages and English.','Essmart will provide:\r\n• The opportunity to work alongside a high-profile successful team\r\n• The opportunity to grow and shape your own role within the company\r\n• Travel throughout rural India\r\nEssmart promises to:\r\n• Encourage you to explore new areas of interest and grow your personal skill set\r\n• Support you in developing your career\r\n• Helping you push your comfort zone where desired\r\n• Be responsive to your feedback and advice, and share responsibility when appropriate\r\nAll new Essmart employees start on a trial-basis or a probationary period, to give us both the\r\nopportunity to work together and find the best fit for growing together in the future. The trial period\r\nis not an exam, but an opportunity to find your role in Essmart. For example, in the past we have\r\ntransitioned great hires into roles that are more appropriate for them based on their skills and\r\ndesires.',NULL,101,17,14,0,NULL,3,20000,28000,1,NULL,1,2,3,1,5,NULL,'2023-11-30 00:00:00',4,1,1,0,NULL,'2023-11-21 10:13:11','2024-04-03 12:18:16',NULL,'Channel Finance Executive',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(59,108,'Field Sales Executive','ob Title: Field Sales Executive\r\n\r\nJob Description:\r\n\r\nResponsibilities:\r\n\r\nProspecting and Lead Generation:\r\n\r\nIdentify and pursue new business opportunities through market research, networking, and cold calling.\r\n\r\nGenerate leads and build a strong sales pipeline.\r\n\r\nClient Engagement:\r\n\r\nConduct face-to-face meetings with potential clients to understand their needs and present products/services effectively.\r\n\r\nEstablish and maintain strong relationships with clients.\r\n\r\nProduct Knowledge:\r\n\r\nStay updated on product features, benefits, and industry trends.\r\n\r\nClearly communicate the value proposition of the products/services to potential clients.\r\n\r\nSales Presentations:\r\n\r\nDeliver compelling sales presentations to showcase the benefits of our products/services.\r\n\r\nAddress client concerns and objections.\r\n\r\nNegotiation and Closing:\r\n\r\nNegotiate terms and close sales deals to achieve sales targets.\r\n\r\nPrepare and submit sales contracts for orders.\r\n\r\nSales Reporting:\r\n\r\nMaintain accurate records of all sales activities, including sales calls, presentations, and closed deals.\r\n\r\nProvide regular sales reports to the management team.\r\n\r\nMarket Intelligence:\r\n\r\nMonitor competitor activities and industry trends to identify business opportunities.\r\n\r\nProvide feedback to the marketing and product development teams.\r\n\r\nTravel:\r\n\r\nTravel to client locations within the assigned territory.\r\n\r\nRequirements:\r\n\r\nProven experience as a Field Sales Executive or a similar role.\r\n\r\nStrong communication and interpersonal skills.\r\n\r\nAbility to work independently and meet sales targets.\r\n\r\nKnowledge of the industry and product/service offerings.\r\n\r\nWillingness to travel and work flexible hours.\r\n\r\nExcellent negotiation and closing skills.','Essmart will provide:\r\n• The opportunity to work alongside a high-profile successful team\r\n• The opportunity to grow and shape your own role within the company\r\n• Travel throughout rural India\r\nEssmart promises to:\r\n• Encourage you to explore new areas of interest and grow your personal skill set\r\n• Support you in developing your career\r\n• Helping you push your comfort zone where desired\r\n• Be responsive to your feedback and advice, and share responsibility when appropriate\r\nAll new Essmart employees start on a trial-basis or a probationary period, to give us both the\r\nopportunity to work together and find the best fit for growing together in the future. The trial period\r\nis not an exam, but an opportunity to find your role in Essmart. For example, in the past we have\r\ntransitioned great hires into roles that are more appropriate for them based on their skills and\r\ndesires.',NULL,101,17,16,0,NULL,3,11000,18000,0,NULL,1,37,3,1,4,NULL,'2023-11-30 00:00:00',41,12,1,0,NULL,'2023-11-21 10:21:16','2024-04-03 12:18:22',NULL,'Field Sales Executive',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(60,112,'Inside Sales Executive','Job Title: Sales Executive\r\n\r\nLocation: Kaikondrahalli, Bangalore\r\n\r\nPosition Type : Fulltime\r\n\r\nIndustry- Real Estate\r\n\r\n\r\n\r\nSalary Range : 4,10,400 (Fixed CTC - 2,30,400 + Variable 1,80,00,00) to 4,18,848 (Fixed 2,38,848 + Variable 1,80,000)\r\n\r\n\r\n\r\nEmployee Value Proposition:\r\n\r\n• Employee health insurance of Rs 1 lakh per year. Premium is paid by the\r\n\r\ncompany. • Employees get free lunch and snacks.\r\n\r\n• Monthly reward and recognition to outstanding performers.\r\n\r\n• Employees get promotions every 6 months based on performance. Outstanding performers\r\n\r\ncan qualify for promotion every quarter. So an employee can get promoted up to 4\r\n\r\ntimes in a year. Every promotion results in a change of designation and increase of\r\n\r\nsalary .\r\n\r\n• Accelerated career growth of employees and one can become UH in another 3 months\r\n\r\ntime)\r\n\r\n• Regular team parties and Annual Day outing for all employees.\r\n\r\n\r\n\r\nQualification / Education and other Requirements:\r\n\r\n• Education- Any 10th / 12th / Diploma.\r\n\r\n• Excellent verbal and written communication.\r\n\r\n• Good Interpersonal skills, numerical and analytical ability.\r\n\r\n• Decision making skills.\r\n\r\n• Language required: English & Hindi (mandatory),\r\n\r\nKannada/Tamil/Marathi/Telugu (optional)\r\n\r\n• Proficient in MS-Office (Excel, Word).\r\n\r\n• Should be flexible for day shift- (9-hour of login between 8 AM - 10 PM). •\r\n\r\nComfortable with working 6 days a week and the week off will be on weekdays.\r\n\r\n\r\n\r\nAbout the company \r\n\r\nNoBroker.com is the world\'s largest C2C marketplace in online real estate. NoBroker is the 37th IndianStartup to have entered the Unicorn club in 2021.\r\n\r\nFor more Information, PFB Company Link for your reference. \r\n\r\nhttps://www.nobroker.in/\r\n\r\nNoBroker is the first prop-tech real estate startup, which has raised $5 million in funding from technology giant Google in an extended Series E round.\r\n\r\nWe are looking forward to associating with you in terms of our requirements at NoBroker.\r\n\r\n\r\n\r\nRole and Responsibility – Sales Executive\r\n\r\n• Identifies business opportunities by identifying prospects.\r\n\r\n• Sells products by establishing contact and developing relationships with prospects recommending\r\n\r\nsolutions.\r\n\r\n• Outbound calling on data collected through lead generation activities / secondary data\r\n\r\nsources. \r\n\r\n• Daily follow-ups on older leads and work on new leads\r\n\r\nAbout Training- Training will be provided for initial few days for an employee to understand end to\r\n\r\nend process.\r\n\r\nYou can reach out to me on 9337605494 or rihana.begum@nobroker.in for further information.','Career Growth opportunity \r\nSalary Hike\r\nFood allowance\r\nHealth Insurance\r\nAttractive Incentive',NULL,101,17,15,0,NULL,2,15000,20000,0,NULL,1,119,3,1,21,NULL,'2023-11-28 00:00:00',41,11,1,0,NULL,'2023-11-23 08:17:57','2024-04-03 12:17:55',NULL,'Inside Sales Executive',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(61,116,'Export Sales Executive','-Identify and research potential export markets for ceramic tiles.\r\n-Generate leads and proactively pursue new business opportunities in international markets.\r\n-Develop and maintain a network of international distributors, agents, and strategic partners.\r\n-Manage the entire export sales process from lead generation to closing deals.\r\n-Build and maintain strong relationships with existing and potential clients.\r\n-Respond to customer inquiries, provide product information, and negotiate pricing and terms of sales agreements.\r\n-Coordinate with the logistics team to arrange shipping, handling, and delivery of export orders.\r\n-Track and report sales performance.\r\n-Prepare regular sales reports, including sales forecasts, market analysis, and revenue projections.\r\n-Provide feedback and recommendations to management on market trends, customer preferences, and sales strategies.',NULL,NULL,101,12,10,0,NULL,3,12000,35000,0,NULL,1,13,3,1,5,NULL,'2023-12-31 00:00:00',4,12,1,0,NULL,'2023-11-24 11:26:50','2024-04-03 12:18:05',NULL,'Export Sales Executive',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(62,113,'TELESALES EXECUTIVE','<div>Walk In Interview -F2F</div>\r\n<div>Position: TELESALES EXECUTIVE.</div>\r\n<div>Location: Bangalore</div>\r\n<div>Experience: 0-1 Years</div>\r\n<div>Salary - 18k CTC per month , Incentive - upto 3k to 30k Per Month.</div>\r\n<div>Immediate Joinee Preferred</div>\r\n<div>Company : Blackbuck</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Qualifications:</div>\r\n<div>Strong communication</div>\r\n<div>Minimum 12th/PUC PASS</div>\r\n<div>Must have know Hindi Language.</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>If you have the experience and qualifications we are looking for and are excited about this opportunity, please send your resume to anil.paikaray@blackbuck.com or ph.No-7606982199.</div>\r\n<div>&nbsp;</div>\r\n<div>Address: Zinka Logistics Solutions Pvt.Ltd. ,</div>\r\n<div>1st Floor, PMN Arcade, Kadubeesanahalli Rd,</div>\r\n<div>Kaverappa Layout, Kadubeesanahalli, Panathur,</div>\r\n<div>Bengaluru, Karnataka 560103</div>\r\n<div>&nbsp;</div>\r\n<div>#telesalesececutive #teleceller #sales #FresherImmediateJoineer #salescareers #salesjobs #salesexecutive #sales #fieldservices #hiring #recruiting #logistics #india #jobs #careers #businessdevelopment #recruitment #job #hr #jobsearch #blackbuck #salescareers #areamanager #immediatejoiners #panindia #helpinghands #covid19 #greatopportunity #trucking #ecommerce #fieldsales #fleetmanagement #teamhandling #hiring #recruiting #share #careers #jobsearch #jobs #nowhiring #job #resume</div>\r\n<div>&nbsp;</div>',NULL,NULL,101,17,15,0,NULL,2,200000,250000,0,NULL,1,137,3,1,30,NULL,'2023-12-31 00:00:00',10,12,1,0,NULL,'2023-11-25 1