LL,'Urgent Requirement  Account Executive',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(69,131,'DESIGN ENGINEER/EXECUTIVE','Business development:\r\n1.	Technical Review of customer enquiries – capability assessment, product selection, etc\r\n2.	Customer Interaction for finalization of Specifications and Design\r\n3.	Sourcing Support to Purchase team\r\n4.	Product Design, Prototyping\r\n5.	Follow-up for Product Approvals by customers\r\n6.	Providing inputs for website and other publications when required\r\nProduct Lifecycle Management:\r\n1.	Production Support – Process Flow Charts, Work Instructions, Drawings, BOMs, Technology Transfer to Operations team.\r\n2.	Tool & Jig Development \r\n3.	Design Documentation, ERP Updations\r\n4.	Design Change Management \r\n5.	Cost Reduction ideas\r\n6.	Technical Support to Customers and Operations Team\r\nQuality Management:\r\n1.	Implementing new standards and customer requirements as and when required.\r\n2.	Periodic reviews of products against UL, RoHS, REACH and other statutory compliances, maintenance of associated documentation','Salary and Benefits: CTC as agreed; PF, Mediclaim, Personal Accident Cover of Rs. 10 Lakhs; Earned Leave, Casual Leave, Sick Leave; PF & Gratuity as applicable; internet enabled mobile telephone connection, laptop. \r\nOther Facilities*: upto 8 days of eCommute annually, 5-day workweek at Bangalore office.',NULL,101,17,16,0,NULL,3,NULL,NULL,0,NULL,1,23,3,NULL,2,NULL,'2024-01-10 00:00:00',9,3,1,0,NULL,'2023-12-19 08:41:37','2024-04-03 12:16:36',NULL,'DESIGN ENGINEER/EXECUTIVE',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(70,129,'ITI/Diploma Electrical',NULL,NULL,NULL,101,17,18,0,NULL,5,16000,17000,0,NULL,1,63,1,4,10,NULL,NULL,43,12,1,0,NULL,'2023-12-20 04:01:31','2024-04-03 12:16:28',NULL,'ITI/Diploma Electrical',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(71,129,'ITI/Diploma Electrical','Maintenance work','PF ESI Food provided on duty',NULL,101,17,18,0,NULL,5,17000,23000,0,NULL,1,63,3,4,10,NULL,NULL,43,1